import React, { useState } from "react";
import "../stylesheets/layouts/Dog.scss";

const Dog = (props) => {
  const genderDogsColor = props.dogs.gender.map((gender, index) => {
    let genderColor = "";
    if (gender === "Female") {
      genderColor = "pink";
    } else {
      genderColor = "blue";
    }

    return <li key={index} genderDogs="gender" className={genderColor}></li>;
  });
  return (
    <article className="article">
      <img
        className="article__image"
        src={props.dogs.url}
        alt={props.dogs.name}
      />
      <div className="nameGender">
        <p className="nameGender__name">{props.dogs.name}</p>
        <div className="nameGender__gender">
          {props.dogs.gender === "Female" ? (
            <i class={` nameGender__gender--female fas fa-venus  `}>
              {genderDogsColor}
            </i>
          ) : (
            <i class={` nameGender__gender--male fas fa-mars `}>
              {genderDogsColor}
            </i>
          )}
        </div>
      </div>

      <button className="article__button">Ver perfil</button>
    </article>
  );
};

export default Dog;
